WIDTH = 360
ARROW_IMAGE = Image.Create(AssetLocation.Base64, "")
PADLOCK_IMAGE = Image.Create(AssetLocation.Base64, "")
PADLOCK_WHITE_IMAGE = Image.Create(AssetLocation.Base64, "")
ACQUIRED_IMAGE = Image.Create(AssetLocation.Base64, "")
ACQUIRED_WHITE_IMAGE = Image.Create(AssetLocation.Base64, "")
EQUIPPED_IMAGE = Image.Create(AssetLocation.Base64, "")
EQUIPPED_WHITE_IMAGE = Image.Create(AssetLocation.Base64, "")



class 'ContextMenu'

function ContextMenu:__init(args)

	self.active = false
	self.position = Vector2(80, 45)
	self.width = 360
	self.headerHeight = 80
	self.headerColor = Color(156, 46, 33)

	self.list = ContextMenuList({subtitle = args.subtitle, subtitleRight = args.subtitleRight})
	self.list.active = true
	
	self.GUIStateObject = SharedObject.Create("GUIState")
	
	Events:Subscribe("Render", self, self.Render)
end


function ContextMenu:SetActive(bool)
	self.GUIStateObject:SetValue(tostring(GUIState.ContextMenu), bool)
	self.active = bool
end


function ContextMenu:Render()
	if Game:GetGUIState() == GUIState.Chat then self:SetActive(false) return end

	if not self.active then return end
	
	if not self.list.active then self.active = false return end
	
	Render:SetFont(AssetLocation.Disk, "Archivo.ttf")
	local position = Vector2(self.position.x, self.position.y)
	
	-- Header
	Render:FillArea(position, Vector2(WIDTH, self.headerHeight), self.headerColor)
	position.y = position.y + self.headerHeight
	
	-- List
	self.list:Render(position, WIDTH)
end



class 'ContextMenuList'

function ContextMenuList:__init(args)
	
	self.subtitle = ContextMenuItem({text = args.subtitle, textRight = args.subtitleRight, active = true})
	self.subtitleNumeric = true
	self.itemHeight = 31
	self.indexSelected = 1
	self.indexFirst = 1
	self.itemActive = nil
	self.maxItems = 10
	self.listPai = nil

	self.arrowImage = ARROW_IMAGE
	
	self.items = {}
end


function ContextMenuList:LabelPostRender()
	self.label:Hide()
end


function ContextMenuList:AddItem(item)
	table.insert(self.items, item)
end


function ContextMenuList:GetKeyDown()
	if timerKeyDown:GetSeconds() > 0.2 and Game:GetGUIState() == GUIState.ContextMenu then

		if Key:IsDown(VirtualKey.Down) then
			self.indexSelected = math.min(self.indexSelected + 1, #self.items)
			self.items[self.indexSelected]:Select()
			
			if self.indexSelected >= self.indexFirst + self.maxItems - 1 then
				self.indexFirst = math.min(self.indexFirst + 1, #self.items - self.maxItems + 1)
			end
			timerKeyDown:Restart()
			return
		end
		
		if Key:IsDown(VirtualKey.Up) then
			self.indexSelected = math.max(self.indexSelected - 1, 1)
			self.items[self.indexSelected]:Select()
			
			if self.indexSelected <= self.indexFirst then
				self.indexFirst = math.max(self.indexFirst - 1, 1)
			end			
			timerKeyDown:Restart()
			return			
		end
		
		if Key:IsDown(VirtualKey.Return) then
			local item = self.items[self.indexSelected]
			
			if item and not item:Press() then
				self.itemActive = item
				item.list.listPai = self
			end
			timerKeyDown:Restart()
			return			
		end
		
		if Key:IsDown(VirtualKey.Back) then
			if self.listPai then
				self.listPai.itemActive = nil
				self.listPai = nil
			end
			timerKeyDown:Restart()
			return			
		end
	end
end


function ContextMenuList:Render(position, width)
	
	if self.itemActive then
		self.itemActive.list:Render(position, width)
		return
	end
	self:GetKeyDown()
	
	if self.subtitleNumeric then
		self.subtitle.textRight = self.indexSelected.."/"..#self.items
	end
	
	-- SubTitle
	Render:FillArea(position, Vector2(width, self.itemHeight), Color.Black)
	self.subtitle:Render(position, Vector2(width, self.itemHeight), false)
	position.y = position.y + self.itemHeight	
	
	-- List
	local heightList = self.itemHeight * math.min(self.maxItems, #self.items)

	Render:FillArea(position, Vector2(width, heightList), Color(0, 0, 0, 150))
	
	local itemSelected = nil
	
	for _ = self.indexFirst, math.min(self.maxItems + self.indexFirst - 1, #self.items) do
		local item = self.items[_]
		if not item then break end
		itemSelected = (self.indexSelected == _ or itemSelected) and item or nil
		item:Render(position, Vector2(width, self.itemHeight), self.indexSelected == _)
		position.y = position.y + self.itemHeight
	end
	position.y = position.y + 2

	-- Footer
	if #self.items > self.maxItems then
		Render:FillArea(position, Vector2(width, self.itemHeight), Color(0, 0, 0, 200))
		self.arrowImage:SetPosition(Vector2(position.x + width / 2, position.y + self.itemHeight / 2) - self.arrowImage:GetSize() / 2)
		self.arrowImage:Draw()
		position.y = position.y + self.itemHeight + 5
	end
	
	-- Legend
	if itemSelected and itemSelected.legend then
		self.items[self.indexSelected].legend:Render(position)
	end
end



class 'ContextMenuItem'

function ContextMenuItem:__init(args)

	self.list = nil
	self.text = tostring(args.text)
	self.textRight = args.textRight and tostring(args.textRight) or nil
	self.margin = Vector2(9, 9)
	self.textSize = 16
	self.image = args.image
	self.data = args.data
	self.legend = ContextMenuLegend({text = args.legend})
	
	self.imageRight = args.imageRight
	self.imageRight_white = args.imageRight_white
	self.enabled = args.enabled
	
	self.selectEvent = function() end
	self.pressEvent = function() end
end


function ContextMenuItem:Select()
	self.selectEvent()
	self.legend:SetText(self.legend.text)
end


function ContextMenuItem:Press()
	if self.list != nil then
		return false
	end
	
	if self.enabled then
		self.pressEvent()
	else
		self.legend:SetText(self.legend.textNotActive)
	end
	return true
end


function ContextMenuItem:Render(position, size, selected)
	local textColor = Color.White
	if selected then
		Render:FillArea(position, size, Color.White)
		textColor = Color.Black
	end
	
	if self.image then
		position.x = position.x + self.imageRight:GetSize().x + self.margin.x
	end
	
	Render:DrawText(position + self.margin, self.text, textColor)
	
	-- ImageRight
	local imgRight = nil
	if self.imageRight then
		imgRight = selected and self.imageRight_white or self.imageRight
		imgRight:SetPosition(Vector2(position.x + size.x - self.margin.x * 2, position.y + size.y / 2) - imgRight:GetSize() / 2)
		imgRight:Draw()
	end
	
	-- TextRight
	if self.textRight and not self.acquired then
		Render:DrawText(position + Vector2(size.x - self.margin.x - Render:GetTextWidth(self.textRight, self.textSize) - (imgRight and imgRight:GetSize().x + self.margin.x or 0), self.margin.y), self.textRight, textColor)
	end
end



class 'ContextMenuLegend'

function ContextMenuLegend:__init(args)

	self.margin = Vector2(10, 10)
	
	self.text = nil
	
	self.label = Label.Create()
	self.label:Hide()
	self.label:SetFont(AssetLocation.Disk, "Archivo.ttf")
	self.label:SetWrap(true)
	--self.label:SetLineSpacing(20)
	self.label:SetWidth(WIDTH - self.margin.x * 2)
	self.label:SetTextSize(16)
	self:SetText(args.text)

	self.label:Subscribe("PostRender", self, self.LabelPostRender)
end


function ContextMenuLegend:SetText(text)
	self.text = text and text or ""
	self.label:SetText(tostring(self.text))
	self.label:SizeToContents()
end


function ContextMenuLegend:SetTempText(text)
	if not text then text = self.text end
	self.label:SetText(tostring(text))
	self.label:SizeToContents()
end


function ContextMenuLegend:LabelPostRender()
	self.label:Hide()
end


function ContextMenuLegend:Render(position)
	Render:FillArea(position, self.label:GetSize() + self.margin * 2, Color(0, 0, 0, 150))
	self.label:Show()	
	self.label:SetPosition(position + self.margin)
end


timerKeyDown = Timer()